import React, {Component} from 'react';
import Button from '@material-ui/core/Button';
import UpdateIcon from '@material-ui/icons/Update';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';

import IconButton from '@material-ui/core/IconButton';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

// import DrawCard from './DrawCard'

import { makeStyles } from '@material-ui/core/styles';
import clsx from 'clsx';
import Collapse from '@material-ui/core/Collapse';
import FavoriteIcon from '@material-ui/icons/Favorite';
import ShareIcon from '@material-ui/icons/Share';
import MoreVertIcon from '@material-ui/icons/MoreVert';

const useStyles = makeStyles(theme => ({
  root: {
    width: 345,
    marginBottom: "14%"
  },
  expand: {
    transform: 'rotate(0deg)',
    // marginRight: 'auto',
    transition: theme.transitions.create('transform', {
      duration: theme.transitions.duration.shortest,
    }),
  },
  expandOpen: {
    transform: 'rotate(180deg)',
  },
}));



export default class WeatherCard extends Component {
  constructor() {
    super();
    this.state = {
      weatherData: null,
      updateTime: null,
    };
    this.getWeather = this.getWeather.bind(this);
    };

  componentDidMount() {
    this.getWeather();
  }

  getWeather() {
    const name = this.props.name;
    const apiKey = '7d7de66dd8d5ba712b4daa70787e46e2'
    const URL = "https://api.openweathermap.org/data/2.5/weather?q=" +
      name +
      "&lang=ru&units=metric&appid=" + apiKey;
    fetch(URL).then(res => res.json()).then(json => {
      this.setState({ weatherData: json });
    });
    this.state.updateTime = new Date();
  }

  render() {
    const weatherData = this.state.weatherData;

    if (!weatherData)
    return (<div>Подождите, данные о погоде загружаются...</div>);

    const weather = weatherData.weather[0];
    const iconUrl = "http://openweathermap.org/img/w/" + weather.icon + ".png";

    return (
      <div>
      <DrawCard
        name={weatherData.name}
        iconUrl={iconUrl}
        description={weatherData.description}
        temp={weatherData.main.temp}
        main={weather.description[0].toUpperCase() + weather.description.substring(1)}
        time={this.state.updateTime.toLocaleTimeString()}
        min={weatherData.main.temp_min}
        max={weatherData.main.temp_max}
        feelsLike={weatherData.main.feels_like}
        wind={weatherData.wind.speed}
      />
      </div>
    );
  }
}

function DrawCard(props) {
  const classes = useStyles();
  const [expanded, setExpanded] = React.useState(false);

  const handleExpandClick = () => {
    setExpanded(!expanded);
  };

  return (
    <Card className={classes.root}>
    <CardContent>
      <Typography variant="h5">
        {props.name}
      </Typography>
      <div className="crutch">
        <Typography variant="h2">
          {Math.round(props.temp)} °С
          </Typography>
        <img
          className="image"
          src={props.iconUrl}
          alt={props.description}
        />
      </div>
      <Typography>
        {props.main}
      </Typography>
      <Typography color="textSecondary">
        Время последнего обновления: {props.time}
      </Typography>
    </CardContent>
    <Collapse in={expanded} timeout="auto" unmountOnExit>
      <CardContent>
      <Typography>
        Мин. t: {Math.round(props.min)} °С
      </Typography>
      <Typography>
        Макс. t: {Math.round(props.max)} °С
      </Typography>
      <Typography>
        Ощущается как: {Math.round(props.feelsLike)} °С
      </Typography>
      <Typography>
        Скорость ветра: {props.wind} м/с
      </Typography>
      </CardContent>
    </Collapse>
      <CardActions>
      <Button
        variant="contained"
        color="primary"
        size="medium"
        startIcon={<UpdateIcon />}
        >Обновить
      </Button>
        <IconButton
          className={clsx(classes.expand, {
            [classes.expandOpen]: expanded,
          })}
          onClick={handleExpandClick}
          aria-expanded={expanded}
          aria-label="Развернуть"
        >
          <ExpandMoreIcon />
        </IconButton>

      </CardActions>

    </Card>
  );
}
